uint32_t randomforest_random_getResult(char *strPtr){
    int theResult;
    uint32_t success = sscanf(strPtr, "%d", &theResult);
    if (!success){
        printf("c ERROR. RANDOMFOREST result extraction from linearized tree failed.\n");
        randomforest_returnCode = RANDOMFOREST_ERROR;
        theResult = CNFCLASSES_RES_SPE_UNRECOGNIZED;
    }
    theResult+=CNFCLASSES_CLASS_MINNUM;
    return theResult;
}

char* randomforest_random_skipBlock(char *strPtr){
    uint32_t numOpening = 1;
    uint32_t numClosing = 0;
    if (*strPtr == '{') ++strPtr;
    while (numClosing < numOpening){
        if (*strPtr == '\0'){
            printf("c ERROR. RANDOMFOREST skip-Block reached end of string. This cannot be.\n");
            randomforest_returnCode = RANDOMFOREST_ERROR;
            return strPtr;
        }
        if (*strPtr == '}'){
            ++numClosing;
            ++strPtr;
        } else if (*strPtr == '{'){
            ++numOpening;
            ++strPtr;
        } else {
            ++strPtr;
        }
    }
    --strPtr;
    return strPtr;
}

char* randomforest_random_checkIf(char *strPtr, uint32_t *answer){
    float checkVal;
    uint32_t i, baseDist = 0, offsetDist = 0;

    for (i=0; i < RANDOMFOREST_RANDOM_NUMCHARS; ++i){
        if (*strPtr == randomforest_random_characters[i]){break;}
    }
    baseDist = i;
    ++strPtr;
    for (i=0; i < RANDOMFOREST_RANDOM_NUMCHARS; ++i){
        if (*strPtr == randomforest_random_characters[i]){break;}
    }
    offsetDist = i;
    ++strPtr;

    if (baseDist == RANDOMFOREST_RANDOM_NUMCHARS || offsetDist == RANDOMFOREST_RANDOM_NUMCHARS){
        printf("c ERROR. RANDOMFOREST found an unknown symbol while checking an if-statement.\n");
        randomforest_returnCode = RANDOMFOREST_ERROR;
        return strPtr;
    }

    uint32_t attID = baseDist*RANDOMFOREST_RANDOM_NUMCHARS + offsetDist;

    uint32_t success = sscanf(strPtr, "%f{", &checkVal);

    if (!success){
        printf("c ERROR. RANDOMFOREST if statement extraction from linearized tree failed.\n");
        randomforest_returnCode = RANDOMFOREST_ERROR;
        return strPtr;
    }

    float_ty attVal = randomforest_random_getFattValueFromID(attID);
    if (attVal == -1.0){
        printf("c ERROR. RANDOMFOREST extracting the attribute value for attribute %d failed.\n", attID);
        randomforest_returnCode = RANDOMFOREST_ERROR;
        return strPtr;
    }

    while (*strPtr != '{'){
        if (*strPtr == '\0'){
            printf("c ERROR. RANDOMFOREST read NULL-byte while checking an IF. This cannot be.\n");
            randomforest_returnCode = RANDOMFOREST_ERROR;
            return strPtr;
        }
        ++strPtr;
    }

    if (attVal < checkVal){
        *answer = 1;
    } else {
        *answer = 0;
    }
    return strPtr;
}

uint32_t randomforest_random_askTree(uint32_t treeID){
    uint32_t result = CNFCLASSES_RES_SPE_UNRECOGNIZED;
    uint32_t answer, strNum;
    char *strPtr = randomforest_random_treestring, *copyPtr;

    for (strNum = 0; strNum < randomforest_random_treeSizes[treeID]; ++strNum){
        copyPtr = randomforest_random_forest[treeID][strNum];
        while (*copyPtr != '\0'){
            *strPtr = *copyPtr;
        	  ++strPtr;
        	  ++copyPtr;
        }
    }
    *strPtr = '\0';

    strPtr = randomforest_random_treestring;

    while (1){
        if (*strPtr == '\0'){
            printf("c ERROR. RANDOMFOREST reached NULL-byte while traversing the tree. This cannot be.\n");
            randomforest_returnCode = RANDOMFOREST_ERROR;
            return result;
        } else if (*strPtr > 96 && *strPtr < 123){
            strPtr = randomforest_random_checkIf(strPtr, &answer);
            if (randomforest_returnCode != RANDOMFOREST_UNKNOWN){return CNFCLASSES_RES_SPE_UNRECOGNIZED;}
            if (!answer){
                strPtr = randomforest_random_skipBlock(strPtr);
                if (randomforest_returnCode != RANDOMFOREST_UNKNOWN){return CNFCLASSES_RES_SPE_UNRECOGNIZED;}
            }
        } else if (*strPtr > 47 && *strPtr < 58){
            result = randomforest_random_getResult(strPtr);
            if (randomforest_returnCode != RANDOMFOREST_UNKNOWN){return CNFCLASSES_RES_SPE_UNRECOGNIZED;}
            break;
        }
        ++strPtr;
    }
    #ifdef VERBOSE_RANDOMFOREST
    printf("c     RANDOMFOREST:     Tree %d votes for class %d.\n", treeID, result);
    #endif
    return result;
}

void randomforest_intern_random_voteAll(){
    #ifdef VERBOSE_RANDOMFOREST
    printf("c     RANDOMFOREST: Classifying (domain RANDOM)...\n");
    #endif

    if (MAIN_GET_FATT_ISSET() == 0){
        printf("c ERROR. RANDOMFOREST cannot classify a formula if the attributes are not computed.\n");
        randomforest_returnCode = RANDOMFOREST_ERROR;
        MAIN_SET_FATT_CLASS(CNFCLASSES_RES_SPE_UNKNOWN);
        return;
    }

    #ifdef VERBOSE_RANDOMFOREST
    printf("c     RANDOMFOREST:   Asking trees for their votes...\n");
    #endif
    uint32_t i, numTrees = 25, maxTreeStrings = 0;

    for (i = 0; i < numTrees; ++i){
        if (randomforest_random_treeSizes[i] > maxTreeStrings){
            maxTreeStrings = randomforest_random_treeSizes[i];
        }
    }

    randomforest_random_treestring = NULL;
    randomforest_random_treestring = malloc(sizeof(char) * 4096 * maxTreeStrings);
    if (randomforest_random_treestring == NULL){
        printf("c ERROR. RANDOMFOREST was unable to allocate the character array for the tree string. Out of memory?\n");
        randomforest_returnCode = RANDOMFOREST_ERROR;
        return;
    }

    for (i=0; i < numTrees; ++i){
        classify_intern_voteForClass(randomforest_random_askTree(i));
        if (randomforest_returnCode != RANDOMFOREST_UNKNOWN){
            if (randomforest_random_treestring != NULL) {free(randomforest_random_treestring); randomforest_random_treestring = NULL;}
            return;
        }
    }
    if (randomforest_random_treestring != NULL) {free(randomforest_random_treestring); randomforest_random_treestring = NULL;}
}
